DROP TABLE IF EXISTS `tddamysqldb`.`elements` CASCADE;

CREATE TABLE `tddamysqldb`.`elements` (
    `Z` integer,
    `Name` text character set utf8,
    `Symbol` text character set utf8,
    `Period` integer,
    `Group` integer,
    `ChemicalSeries` text character set utf8,
    `AtomicWeight` double,
    `Etymology` text character set utf8,
    `RelativeAtomicMass` double,
    `MeltingPointC` double,
    `MeltingPointKelvin` double,
    `BoilingPointC` double,
    `BoilingPointF` double,
    `Density` double,
    `Description` text character set utf8,
    `Colour` text character set utf8
);

;
